import React from "react";

import './style.css'


function Header() {
  return( 
    <div className="container">
      <div className="row">
        <div className="headerBox col-md-12">
          <h1>Hike Diary</h1>
          <p className="headerSubtitle"> Keep Track of Your Treks </p>
        </div>
      </div>
    </div>
  )}

export default Header;
